    "2016-03-17T20:52:05.940847",nt"name": "iowa-carbon-monoxide-emergency-department-visits",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains case counts of Carbon
    Monoxide Emergency Department visits in the state of Iowa during the year.Case counts
    include unintentional fire-related poisoning, unintentional non-fire related poisoning,
    and undetermined source poisoning. Data are stratified by age group, sex, and county.
     This dataset is intended to provide data consistent with the guidance for creating
    carbon monoxide emergency department visit Nationally Consistent Data Measures (NCDMs).
     The data contained in this dataset is collected by the Iowa Hospital Association
    on behalf of the Iowa Department of Public Health in accordance with Iowa Code section
    135.166. This dataset contains confidential information. Small numbers suppression
    has been applied to data available on the public portal. The measures include Emergency
    Department encounters that result in inpatient admissions as well as Emergency Department
    only encounters.",nt"license_title": "License Not Specified",nt"extras":
